import  getCss from "../styles/Header.module.css"
export default function Header(){

    return(
    <div className="konkuk_pic">
        
        <img style={{
        width:"103px",
        height:37,
        position:"absolute",
        top:14,
        left:18
        }}  alt="konkuk_pic" src={konkukPic}></img>
        <text></text>
    </div>
    )
    
}//103 30
